	    - W(R266B) + W(R267F) - W(R267B) & 
	    + W(R281F) - W(R281B) - W(R282F) & 
	    + W(R282B)
      CDOT(SN2) = - W(R36F) + W(R36F) - W(R36B) & 
	    + W(R36B) - W(R142F) + W(R142F) & 
	    - W(R142B) + W(R142B) + W(R178F) & 
	    - W(R178B) + W(R181F) - W(R181B) & 
	    + W(R183F) - W(R183B) + W(R184F) & 
	    - W(R184B) + W(R185F) - W(R185B) & 
	    + W(R196F) - W(R196B) + W(R198F) & 
	    - W(R198B) + W(R204F) - W(R204B) & 
	    + W(R205F) - W(R205B) + W(R206F) & 
	    - W(R206B) + W(R207F) - W(R207B) & 
	    + W(R209F) - W(R209B) + W(R210F) & 
	    - W(R210B) + W(R211F) - W(R211B) & 
	    + W(R225F) - W(R225B) + W(R229F) & 
	    - W(R229B) + W(R238F) - W(R238B) & 
	    - W(R239F) + W(R239B) - W(R240F)
      CDOT(SN2) = CDOT(SN2) + W(R240B) - W(R241F) + W(R241B) & 
	    - W(R242F) + W(R242B) - W(R243F) & 
	    + W(R243B) + W(R257F) - W(R257B) & 
	    + W(R259F) - W(R259B) + W(R260F) & 
	    - W(R260B) + W(R261F) - W(R261B)
      CDOT(SAR) = - W(R37F) + W(R37F) - W(R37B) & 
	    + W(R37B) - W(R143F) + W(R143F) & 
	    - W(R143B) + W(R143B)
      CDOT(SC3H7) = W(R313F) - W(R313B) + W(R314F) & 
	    - W(R314B) + W(R315F) - W(R315B) & 
	    - W(R316F) + W(R316B) + W(R317F) & 
	    - W(R317B) + W(R318F) - W(R318B) & 
	    - W(R319F) + W(R319B) - W(R320F) & 
	    + W(R320B) - W(R321F) + W(R321B) & 
	    - W(R322F) + W(R322B) - W(R323F) & 
	    + W(R323B) - W(R324) - W(R325F) & 
	    + W(R325B)
      CDOT(SC3H8) = W(R312F) - W(R312B) - W(R313F) & 
	    + W(R313B) - W(R314F) + W(R314B) & 
	    - W(R315F) + W(R315B) + W(R316F) & 
	    - W(R316B) - W(R317F) + W(R317B) & 
	    + W(R320F) - W(R320B) + W(R323F) & 
	    - W(R323B)
      CDOT(SCH2CHO) = W(R285F) - W(R285B) + W(R294F) & 
	    - W(R294B) + W(R296F) - W(R296B) & 
	    + W(R299F) - W(R299B) + W(R304F) & 
	    - W(R304B) - W(R305) - W(R306) & 
	    - W(R307) - W(R308F) + W(R308B) & 
	    - W(R309F) + W(R309B) - W(R310F) & 
	    + W(R310B) - W(R311F) + W(R311B)
      CDOT(SCH3CHO) = W(R286F) - W(R286B) - W(R296F) & 
	    + W(R296B) - W(R297) - W(R298) & 
	    - W(R299F) + W(R299B) - W(R300) & 
	    - W(R301) - W(R302) - W(R303)
      CDOT(SVTAR1) = 0.0_DP
      CDOT(SVTAR2) = 0.0_DP
      CDOT(SVTAR3) = 0.0_DP
      CDOT(SBTX2) = 0.0_DP
      CDOT(SCOALSOLIDCOAL1) = 0.0_DP
      CDOT(SCOALSOLIDGCOAL1) = 0.0_DP
      CDOT(SCOALSOLIDGCH2) = 0.0_DP
      CDOT(SCOALSOLIDCHAR) = 0.0_DP
      CDOT(SCOALSOLIDCHARH) = 0.0_DP
      CDOT(SCOALSOLIDTAR1) = 0.0_DP
      CDOT(SCOALSOLIDCOAL2) = 0.0_DP
      CDOT(SCOALSOLIDGBTX2) = 0.0_DP
      CDOT(SCOALSOLIDGCH4) = 0.0_DP
