subroutine SJACOBIAN( dmdY, K, C)
!----------------------------------------------------------
!     THIS SUBROUTINE COMPUTES RATES OF PRODUCTION CDOT
!     IN [KMOLE/(M^3S)]. 
!----------------------------------------------------------
      implicit none
      include 'gri.30F90.h'
      real(DP) :: dmdY(77,77),K(634), &
      C(77)
      integer ::  I




      dmdY(SH2,SH2) =  & 
	    - K(R3F) * C(SO) - K(R8B) * C(SCO) + K(R39F) * C(SH)**2 * 0  & 
	    - K(R39B) * M(MM5) - K(R39B) * C(SH2) * 0  - K(R41B) * C(SH2O) & 
	    - K(R42B) * C(SCO2) - K(R45B) * C(SO2) - K(R47B) * C(SHO2) & 
	    - K(R49B) * C(SC) - K(R51B) * C(SCH) - K(R53B) * C(SCH3) & 
	    - K(R55B) * C(SCO) - K(R58B) * C(SHCO) - K(R60B) * C(SCH2O) & 
	    - K(R65B) * C(SCH2O) - K(R68B) * C(SCH2OH) - K(R69B) * C(SCH3O) & 
	    - K(R73B) * C(SC2H2) - K(R75B) * C(SC2H3) - K(R77B) * C(SC2H4) & 
	    - K(R78B) * C(SC2H5) - K(R80B) * C(SHCCO) - K(R83F) * C(SCO) & 
	    - K(R84F) * C(SOH) - K(R126F) * C(SCH) - K(R136F) * C(SCH2) & 
	    - K(R137B) * C(SC2H2) - K(R146F) * C(SCH2(S)) - K(R172F) * C(SC2H) & 
	    - K(R174B) * C(SC2H2) - K(R191B) * C(SN) - K(R197B) * C(SHNO) & 
	    - K(R202B) * C(SNH) - K(R209B) * C(SN2) - K(R214B) * C(SNO) & 
	    - K(R221F) * C(SCN) - K(R266B) * C(SNCO) - K(R276B) * C(SHCN) & 
	    - K(R277B) * C(SNH2) - K(R289F) * C(SCH) - K(R299B) * C(SCH2CHO) & 
	    - K(R309B) * C(SCH2CO) - K(R314B) * C(SC3H7)
      dmdY(SH2,SH) =  & 
	    + K(R3B) * C(SOH) + K(R39F) * 2 * C(SH)**1 * M(MM5) + K(R39F) * C(SH)**2 & 
	    - K(R39B) * C(SH2) + 2 * K(R40F) * C(SH2) * 2 * C(SH)**1 + K(R41F) * 2 * C(SH)**1 * C(SH2O) & 
	    + K(R42F) * 2 * C(SH)**1 * C(SCO2) + K(R45F) * C(SHO2) + K(R47F) * C(SH2O2) & 
	    + K(R49F) * C(SCH) + K(R51F) * C(SCH2(S)) + K(R53F) * C(SCH4) & 
	    + K(R55F) * C(SHCO) + K(R58F) * C(SCH2O) + K(R60F) * C(SCH2OH) & 
	    + K(R65F) * C(SCH3O) + K(R68F) * C(SCH3OH) + K(R69F) * C(SCH3OH) & 
	    + K(R73F) * C(SC2H3) + K(R75F) * C(SC2H4) + K(R77F) * C(SC2H5) & 
	    + K(R78F) * C(SC2H6) + K(R80F) * C(SCH2CO) + K(R84B) * C(SH2O) & 
	    + K(R126B) * C(SCH2) + K(R136B) * C(SCH3) + K(R146B) * C(SCH3) & 
	    + K(R172B) * C(SC2H2) + K(R191F) * C(SNH) + K(R202F) * C(SNH2) & 
	    + K(R209F) * C(SNNH) + K(R214F) * C(SHNO) + K(R221B) * C(SHCN) & 
	    + K(R266F) * C(SHNCO) + K(R277F) * C(SNH3) + K(R299F) * C(SCH3CHO) & 
	    + K(R300) * C(SCH3CHO) + K(R309F) * C(SCH2CHO) + K(R314F) * C(SC3H8)
      dmdY(SH2,SO) =  & 
	    - K(R3F) * C(SH2) + K(R8F) * C(SCH2(S)) + K(R39F) * C(SH)**2 & 
	    - K(R39B) * C(SH2) + K(R284) * C(SCH3)
      dmdY(SH2,SO2) =  & 
	    + K(R39F) * C(SH)**2 - K(R39B) * C(SH2) - K(R45B) * C(SH2)
      dmdY(SH2,SOH) =  & 
	    + K(R3B) * C(SH) + K(R39F) * C(SH)**2 - K(R39B) * C(SH2) & 
	    - K(R84F) * C(SH2) + K(R288) * C(SCH3)
      dmdY(SH2,SH2O) =  & 
	    + K(R39F) * C(SH)**2 * 0  - K(R39B) * C(SH2) * 0  + K(R84B) * C(SH) & 
	    + K(R197F) * C(SNH) + K(R293) * C(SCH2(S))
      dmdY(SH2,SHO2) =  & 
	    + K(R39F) * C(SH)**2 - K(R39B) * C(SH2) + K(R45F) * C(SH) & 
	    - K(R47B) * C(SH2)
      dmdY(SH2,SH2O2) =  & 
	    + K(R39F) * C(SH)**2 - K(R39B) * C(SH2) + K(R47F) * C(SH)
      dmdY(SH2,SC) =  & 
	    + K(R39F) * C(SH)**2 - K(R39B) * C(SH2) - K(R49B) * C(SH2)
      dmdY(SH2,SCH) =  & 
	    + K(R39F) * C(SH)**2 - K(R39B) * C(SH2) + K(R49F) * C(SH) & 
	    - K(R51B) * C(SH2) - K(R126F) * C(SH2) - K(R289F) * C(SH2)
      dmdY(SH2,SCH2) =  & 
	    + K(R39F) * C(SH)**2 - K(R39B) * C(SH2) + K(R126B) * C(SH) & 
	    - K(R136F) * C(SH2) + K(R137F) * 2 * C(SCH2)**1
      dmdY(SH2,SCH2(S)) =  & 
	    + K(R8F) * C(SO) + K(R39F) * C(SH)**2 - K(R39B) * C(SH2) & 
	    + K(R51F) * C(SH) - K(R146F) * C(SH2) + K(R293) * C(SH2O)
      dmdY(SH2,SCH3) =  & 
	    + K(R39F) * C(SH)**2 - K(R39B) * C(SH2) - K(R53B) * C(SH2) & 
	    + K(R136B) * C(SH) + K(R146B) * C(SH) + K(R276F) * C(SN) & 
	    + K(R284) * C(SO) + K(R288) * C(SOH) + K(R289B)
      dmdY(SH2,SCH4) =  & 
	    + K(R39F) * C(SH)**2 * 2  - K(R39B) * C(SH2) * 2  + K(R53F) * C(SH)
      dmdY(SH2,SCO) =  & 
	    - K(R8B) * C(SH2) + K(R39F) * C(SH)**2 - K(R39B) * C(SH2) & 
	    - K(R55B) * C(SH2) - K(R83F) * C(SH2)
      dmdY(SH2,SCO2) =  & 
	    + K(R39F) * C(SH)**2 * 0  - K(R39B) * C(SH2) * 0 
      dmdY(SH2,SHCO) =  & 
	    + K(R39F) * C(SH)**2 - K(R39B) * C(SH2) + K(R55F) * C(SH) & 
	    - K(R58B) * C(SH2)
      dmdY(SH2,SCH2O) =  & 
	    + K(R39F) * C(SH)**2 - K(R39B) * C(SH2) + K(R58F) * C(SH) & 
	    - K(R60B) * C(SH2) - K(R65B) * C(SH2) + K(R83B)
      dmdY(SH2,SCH2OH) =  & 
	    + K(R39F) * C(SH)**2 - K(R39B) * C(SH2) + K(R60F) * C(SH) & 
	    - K(R68B) * C(SH2)
      dmdY(SH2,SCH3O) =  & 
	    + K(R39F) * C(SH)**2 - K(R39B) * C(SH2) + K(R65F) * C(SH) & 
	    - K(R69B) * C(SH2)
      dmdY(SH2,SCH3OH) =  & 
	    + K(R39F) * C(SH)**2 - K(R39B) * C(SH2) + K(R68F) * C(SH) & 
	    + K(R69F) * C(SH)
      dmdY(SH2,SC2H) =  & 
	    + K(R39F) * C(SH)**2 - K(R39B) * C(SH2) - K(R172F) * C(SH2)
      dmdY(SH2,SC2H2) =  & 
	    + K(R39F) * C(SH)**2 - K(R39B) * C(SH2) - K(R73B) * C(SH2) & 
	    - K(R137B) * C(SH2) + K(R172B) * C(SH) - K(R174B) * C(SH2)
      dmdY(SH2,SC2H3) =  & 
	    + K(R39F) * C(SH)**2 - K(R39B) * C(SH2) + K(R73F) * C(SH) & 
	    - K(R75B) * C(SH2)
      dmdY(SH2,SC2H4) =  & 
	    + K(R39F) * C(SH)**2 - K(R39B) * C(SH2) + K(R75F) * C(SH) & 
	    - K(R77B) * C(SH2) + K(R174F)
      dmdY(SH2,SC2H5) =  & 
	    + K(R39F) * C(SH)**2 - K(R39B) * C(SH2) + K(R77F) * C(SH) & 
	    - K(R78B) * C(SH2)
      dmdY(SH2,SC2H6) =  & 
	    + K(R39F) * C(SH)**2 * 3  - K(R39B) * C(SH2) * 3  + K(R78F) * C(SH)
      dmdY(SH2,SHCCO) =  & 
	    + K(R39F) * C(SH)**2 - K(R39B) * C(SH2) - K(R80B) * C(SH2)
      dmdY(SH2,SCH2CO) =  & 
	    + K(R39F) * C(SH)**2 - K(R39B) * C(SH2) + K(R80F) * C(SH) & 
	    - K(R309B) * C(SH2)
      dmdY(SH2,SHCCOH) =  & 
	    + K(R39F) * C(SH)**2 - K(R39B) * C(SH2)
      dmdY(SH2,SN) =  & 
	    + K(R39F) * C(SH)**2 - K(R39B) * C(SH2) - K(R191B) * C(SH2) & 
	    + K(R276F) * C(SCH3)
      dmdY(SH2,SNH) =  & 
	    + K(R39F) * C(SH)**2 - K(R39B) * C(SH2) + K(R191F) * C(SH) & 
	    + K(R197F) * C(SH2O) - K(R202B) * C(SH2)
      dmdY(SH2,SNH2) =  & 
	    + K(R39F) * C(SH)**2 - K(R39B) * C(SH2) + K(R202F) * C(SH) & 
	    - K(R277B) * C(SH2)
      dmdY(SH2,SNH3) =  & 
	    + K(R39F) * C(SH)**2 - K(R39B) * C(SH2) + K(R277F) * C(SH)
      dmdY(SH2,SNNH) =  & 
	    + K(R39F) * C(SH)**2 - K(R39B) * C(SH2) + K(R209F) * C(SH)
      dmdY(SH2,SNO) =  & 
	    + K(R39F) * C(SH)**2 - K(R39B) * C(SH2) - K(R214B) * C(SH2)
      dmdY(SH2,SNO2) =  & 
	    + K(R39F) * C(SH)**2 - K(R39B) * C(SH2)
      dmdY(SH2,SN2O) =  & 
	    + K(R39F) * C(SH)**2 - K(R39B) * C(SH2)
      dmdY(SH2,SHNO) =  & 
	    + K(R39F) * C(SH)**2 - K(R39B) * C(SH2) - K(R197B) * C(SH2) & 
	    + K(R214F) * C(SH)
      dmdY(SH2,SCN) =  & 
	    + K(R39F) * C(SH)**2 - K(R39B) * C(SH2) - K(R221F) * C(SH2)
      dmdY(SH2,SHCN) =  & 
	    + K(R39F) * C(SH)**2 - K(R39B) * C(SH2) + K(R221B) * C(SH) & 
	    - K(R276B) * C(SH2)
      dmdY(SH2,SH2CN) =  & 
	    + K(R39F) * C(SH)**2 - K(R39B) * C(SH2)
      dmdY(SH2,SHCNN) =  & 
	    + K(R39F) * C(SH)**2 - K(R39B) * C(SH2)
      dmdY(SH2,SHCNO) =  & 
	    + K(R39F) * C(SH)**2 - K(R39B) * C(SH2)
      dmdY(SH2,SHOCN) =  & 
	    + K(R39F) * C(SH)**2 - K(R39B) * C(SH2)
      dmdY(SH2,SHNCO) =  & 
	    + K(R39F) * C(SH)**2 - K(R39B) * C(SH2) + K(R266F) * C(SH)
      dmdY(SH2,SNCO) =  & 
	    + K(R39F) * C(SH)**2 - K(R39B) * C(SH2) - K(R266B) * C(SH2)
      dmdY(SH2,SN2) =  & 
	    + K(R39F) * C(SH)**2 - K(R39B) * C(SH2) - K(R209B) * C(SH2)
      dmdY(SH2,SAR) =  & 
	    + K(R39F) * C(SH)**2 * 0.63  - K(R39B) * C(SH2) * 0.63 
      dmdY(SH2,SC3H7) =  & 
	    + K(R39F) * C(SH)**2 - K(R39B) * C(SH2) - K(R314B) * C(SH2)
      dmdY(SH2,SC3H8) =  & 
	    + K(R39F) * C(SH)**2 - K(R39B) * C(SH2) + K(R314F) * C(SH)
      dmdY(SH2,SCH2CHO) =  & 
	    + K(R39F) * C(SH)**2 - K(R39B) * C(SH2) - K(R299B) * C(SH2) & 
	    + K(R309F) * C(SH)
      dmdY(SH2,SCH3CHO) =  & 
	    + K(R39F) * C(SH)**2 - K(R39B) * C(SH2) + K(R299F) * C(SH) & 
	    + K(R300) * C(SH)
      dmdY(SH2,SVTAR1) =  & 
	    + K(R39F) * C(SH)**2 - K(R39B) * C(SH2)
      dmdY(SH2,SVTAR2) =  & 
	    + K(R39F) * C(SH)**2 - K(R39B) * C(SH2)
      dmdY(SH2,SVTAR3) =  & 
