      dmdY(SH2,SBTX2) =  & 
	    + K(R39F) * C(SH)**2 - K(R39B) * C(SH2)
      dmdY(SH2,SCOALSOLIDCOAL1) =  & 
	    + K(R39F) * C(SH)**2 - K(R39B) * C(SH2)
      dmdY(SH2,SCOALSOLIDGCOAL1) =  & 
	    + K(R39F) * C(SH)**2 - K(R39B) * C(SH2)
      dmdY(SH2,SCOALSOLIDGCH2) =  & 
	    + K(R39F) * C(SH)**2 - K(R39B) * C(SH2)
      dmdY(SH2,SCOALSOLIDCHAR) =  & 
	    + K(R39F) * C(SH)**2 - K(R39B) * C(SH2)
      dmdY(SH2,SCOALSOLIDCHARH) =  & 
	    + K(R39F) * C(SH)**2 - K(R39B) * C(SH2)
      dmdY(SH2,SCOALSOLIDTAR1) =  & 
	    + K(R39F) * C(SH)**2 - K(R39B) * C(SH2)
      dmdY(SH2,SCOALSOLIDCOAL2) =  & 
	    + K(R39F) * C(SH)**2 - K(R39B) * C(SH2)
      dmdY(SH2,SCOALSOLIDGBTX2) =  & 
	    + K(R39F) * C(SH)**2 - K(R39B) * C(SH2)
      dmdY(SH2,SCOALSOLIDGCH4) =  & 
	    + K(R39F) * C(SH)**2 - K(R39B) * C(SH2)
      dmdY(SH2,SCOALSOLIDGCOH2) =  & 
	    + K(R39F) * C(SH)**2 - K(R39B) * C(SH2)
      dmdY(SH2,SCOALSOLIDGCO2S) =  & 
	    + K(R39F) * C(SH)**2 - K(R39B) * C(SH2)
      dmdY(SH2,SCOALSOLIDGH2O) =  & 
	    + K(R39F) * C(SH)**2 - K(R39B) * C(SH2)
      dmdY(SH2,SCOALSOLIDGCOL) =  & 
