      dmdY(SH2,SCOALSOLIDGCOAL3) =  & 
	    + K(R39F) * C(SH)**2 - K(R39B) * C(SH2)
      dmdY(SH2,SCOALSOLIDTAR3) =  & 
	    + K(R39F) * C(SH)**2 - K(R39B) * C(SH2)
      dmdY(SH2,SCOALSOLIDGCO2) =  & 
